import React from 'react';
import FormControl from '@material-ui/core/FormControl';
import FormHelperText from '@material-ui/core/FormHelperText';
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';
import ValidationAlert from '../ValidationAlert';

function SelectInput({ name, label, type, value, alert, options, setInputs }) {
    return (
        <div className={test}>
            <FormControl variant="outlined">
                <FormHelperText>{label}</FormHelperText>
                <Select id={name} name={name} type={type} value={value} onChange={setInputs} >
                    {options && options.map(option => <MenuItem key={option.value} value={option.value}>{option.name}</MenuItem>)}
                </Select>
            </FormControl>
            <ValidationAlert content={alert} />
        </div>
    )
}

export default SelectInput;
